import React from 'react'
import './bookDetails.css'

function BookDetailsDisplay({input, bookstatus}) {
    const {bookInput, authorInput, genre, status} = input

    if (bookstatus) {
        return (
            <div>
                <h2>Your Book Details</h2>
                <h5>{bookInput}</h5>
                <h5>{authorInput}</h5>
                <h5>{genre}</h5>
                <h5>{status}</h5>
            </div>
        )
    }
}

export default BookDetailsDisplay
